ag/freeenglishclass?source=feed_text&amp;story_id=1823875087893232" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1823875087893232" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/englishcommunity?source=feed_text&amp;story_id=1823875087893232" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">EnglishCommunity</span></span></a></p></div><!--EndFragment--><p><br/></p><p><br/></p>','contentable_id' => '7','contentable_type' => 'App\\Post','created_at' => '2016-12-09 17:45:41','updated_at' => '2016-12-09 17:45:41','deleted_at' => NULL),
  array('id' => '8','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=10154885054294421" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneTuesdayClass</span></span></a> Proudly Presents: &#34;A Class of Conversation&#34;</p><p style="font-size: 14px;">The best conversation is the one in which you dont have to worry about what you\'re supposed to say and what\'s not, you can just simply be you - Anonym</p><p style="font-size: 14px;">Conversation is essential as we\'re bound to make conversation with others. But how important is it? To what extent?<span class="text_exposed_show"><br/>What types of conversation do you like the most ? traveling? culture? politic? or maybe, yourself?</span></p><div class="text_exposed_show" style="font-size: 14px;"><p>If you think you want to make some conversations with us, to share your thoughts, experiences, comments or opinions, let\'s clear your schedule because we will sure make some great conversations.</p><p>Our Tuesday class will be held on December 13th, 2016, starting at 18.30 until 20.00. It will be held at Warung Bang Dairy,Jl. Anggrek Cakra No. 52, Kelapa Dua, Kebon Jeruk, West Jakarta.</p><p>Please click this link for location:<br/><a href="https://www.facebook.com/l.php?u=https%3A%2F%2Fwaze.to%2Flr%2Fhqqgutweqq&amp;h=kAQH7gBO_AQEW9ZiodktH6tKsW4aVYzo1NXe9sU41sz-ANw&amp;enc=AZOBBw_7qJDmzxAmKVoa-VAlNP6IJGb3bKSAdZBue0EZJpDEhv43AS54tQhQK6awxOLYHkHb1Pwtb2ZEkYrf1-srPZMxWRHKYBBqdmD1u5l6gl4BlbwpF1HGikWEE5jrCip9rctkc7hNGQIgsWQsW1xl_dh5CQ1UiDIox-FSDSdZwsuaFsk2dAFzd6xo_srdWLw&amp;s=1" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">https://waze.to/lr/hqqgutweqq</a></p><p>See you there.</p><p>Britzone is supported by <a href="http://atmago.com/" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">Atmago.com</a></p><p>Atmago is now available on Playstore, please click this link to download : <a href="http://www.atmago.com/android" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">www.atmago.com/android</a></p><p><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=10154885054294421" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=10154885054294421" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=10154885054294421" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=10154885054294421" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=10154885054294421" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/englishcommunity?source=feed_text&amp;story_id=10154885054294421" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">EnglishCommunity</span></span></a></p></div><!--EndFragment--><p><br/></p><p><br/></p>','contentable_id' => '8','contentable_type' => 'App\\Post','created_at' => '2016-12-13 10:20:54','updated_at' => '2016-12-13 10:20:54','deleted_at' => NULL),
  array('id' => '9','content' => '<p>#BritzoneSpeakingAcademy proudly presents: &#34;Practice dealing with Interview&#34; by Bunga<br/><br/>Regarding to wikipedia, an interview is a  conversation where questions are asked and answers are given. You\'re going to face interview when you want to get a job, scholarship, or other ocassions in life that you pursue. Interview is one of the milestone you need to be done in terms of your career. Once you succeed to get through interview, you\'re getting closer to your goal. <br/><br/>This time, Britzone Speaking Acadamy is going to have &#34;Practice Dealing with Interview&#34; which is the 5th class or in other word, the last session of dealing with interview. This last session is going to be conducted by Bunga Use, an English Teacher. <br/><br/>What are you waiting for? If you want to practice your English especially speaking skill in terms of interview, mark your calendar on 14 December 2016. We\'re going to start at 6:30 PM until 8:00 PM in detik.com\'s office, at Aldevco Octagon building, 5th floor, jl. Buncit raya no 11, Pejaten, South Jakarta (in front of Buncit Indah shelter). So, don\'t miss it, guys! We will see you in the venue and practice together, because as you know, practice makes perfect! &#128521; see you there!<br/><br/>- Britzone is supported by AtmaGo.com -<br/><br/>AtmaGo is now available on playstore, please click this link to download: www.atmago.com/android<br/><br/>#BritzoneID #Britzone #Jakarta #FreeEnglishClub #FreeEnglishClass #EnglishCommunity #BSA #Interview<br/></p>','contentable_id' => '9','contentable_type' => 'App\\Post','created_at' => '2016-12-14 11:13:28','updated_at' => '2016-12-14 11:13:28','deleted_at' => NULL),
  array('id' => '10','content' => '<p><br/></p><div class="_5pbx userContent" id="js_1b7f" style="font-size: 14px;"><div id="id_585a3e71eaa0d3253876195" class="text_exposed_root text_exposed"><p><a class="_58cn" href="https://www.facebook.com/hashtag/britzonefunday?source=feed_text&amp;story_id=1828344190779655" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneFunDay</span></span></a> proudly presents:<br/>&#34;We\'ll be Civil&#34;</p><p>In this digital era, social media represents an unusual element. It is a place where we can share our most private thoughts without having to meet directly with others.</p><div class="text_exposed_show"><p>And, needless to say, this liberty imbued some people with a sense of entitlement: the feeling of having the rights of unleashing whatever came to their mind without remorse or worry of repercussions.</p><p>This saturday, Britzone proudly presents &#34;We\'ll Be Civil&#34; where participants will take turns to present their idea or suggestion from any source, online or otherwise, on how to carry ourselves with more control and conduct in social media.</p><p>The class will start around 11.00 and take place in Warung Bang Dairy, Jl. Anggrek No. 52, Kelapa Dua, Kb. Jeruk. Don\'t miss it!</p><p>Please click this link for location:<br/><a href="https://waze.to/lr/hqqgutweqq" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">https://waze.to/lr/hqqgutweqq</a> -Britzone is supported by Atmago.com-</p><p>Atmago is now available on Playstore, please click this link to download : <a href="http://www.atmago.com/android" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">www.atmago.com/android</a><br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1828344190779655" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1828344190779655" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1828344190779655" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1828344190779655" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <span class="_5afx" style="direction: ltr;"><a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1828344190779655" style="color: rgb(54, 88, 153);"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></a> </span><a class="_58cn" href="https://www.facebook.com/hashtag/socialmedia?source=feed_text&amp;story_id=1828344190779655" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">socialmedia</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bfd?source=feed_text&amp;story_id=1828344190779655" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BFD</span></span></a></p></div></div></div><div class="_3x-2" style="font-size: 12px;"><div><div class="mtm"><a class="_4-eo _2t9n _50z9" href="https://www.facebook.com/photo.php?fbid=1828344180779656&amp;set=a.1400290060251739.1073741829.100008122752585&amp;type=3" rel="theater" style="color: rgb(54, 88, 153);width: 487px;"><!--EndFragment--><br/></a></div></div></div><p><br/></p>','contentable_id' => '10','contentable_type' => 'App\\Post','created_at' => '2016-12-21 08:37:55','updated_at' => '2016-12-21 08:37:55','deleted_at' => NULL),
  array('id' => '11','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneclp?source=feed_text&amp;story_id=1830382453909162" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneCLP</span></span></a> class proudly presents:<br/>&#34;Practicing in academic writing&#34; by Bunga</p><p style="font-size: 14px;">You can make everything by writing - Hanifah.<br/>Do you think writing is easy? Just take your pen and a paper, so the world is yours! But, writing is not only about that, if you want to continue your study especially to study abroad, you have to know more about academic writing.</p><div class="text_exposed_show" style="font-size: 14px;"><p>What is the difference with ordinary writing? Do you think your essay is not good enough? So, there are many things that you should know about writing especially academic writing, you\'d better know about all of this!</p><p>What are you waiting for? If you want to practice your English especially writing skill, mark your calendar on 20 December 2016. We\'re going to start at 6:30 PM until 8:00 PM in <a href="http://l.facebook.com/l.php?u=http%3A%2F%2Fdetik.com%2F&amp;h=gAQH8_FJQAQEmC6Wz5HxUK2GSQC06pB3A5WgwJaRvyvAWAg&amp;enc=AZPrsBr85hJXoLZHST97trT8wzsLhFwd3zeqsAfP9lBdeXELiSGhjXSoZU-ayOueDsf8o5TJno4uIcsNpy6HG-Pl4-XTf3XcWyj-kg31z6jFLIMLoMtlJM1XA3NgDld5sni0qV023jMVg_BCAeC9f7uVn7hg_0lZa1sCQ0s1CPoh5gMsAsTNjgSDc6bFV7aIfF2o6ndyN8nkNL26gdKeZmg_&amp;s=1" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">detik.com</a>\'s office, at Aldevco Octagon building, 5th floor, jl. Buncit raya no 11, Pejaten, South Jakarta (in front of Buncit Indah shelter). So, don\'t miss it, guys! We will see you in the venue and practice together, because as you know, practice makes perfect! <span class="_5mfr _47e3" style="vertical-align: middle;"><img class="img" height="16" src="https://www.facebook.com/i