  array('id' => '12','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonespeakingacademy?source=feed_text&amp;story_id=1830882503859157" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneSpeakingAcademy</span></span></a> proudly present:<br/>&#34;Practicing in debating&#34; by Akhmad Irfai</p><p style="font-size: 14px;">&#34;I may be wrong and you may be right and, by an effort, we may get nearer the truth.&#34; Karl Popper</p><div class="text_exposed_show" style="font-size: 14px;"><p>Debate is a formal contest of argumentation between two teams or individuals. But more importantly, debate is an essential tool for developing and maintaining democracy and open societies. More than a mere verbal or performance skill, debate embodies the ideals of reasoned argument, tolerance for divergent points of view and rigorous self-examination.</p><p>Debate is, above all, a way for those who hold opposing views to discuss controversial issues without descending to insult, emotional appeals or personal bias. A key trademark of debate is that it rarely ends in agreement, but rather allows for a robust analysis of the question at hand. Perhaps this is what French philosopher Joseph Joubert meant when he said: “It is better to debate a question without settling it, than to settle a question without debating it.”</p><p>In favor of the last meeting of debating in BSA class, it is an honor to bring you an atmosphere where you can practice in debating, which will be conducted by Akhmad Rifai. So, please clear your schedule this Wednesday, Dec 21st, 2016. The class will start at 18.30 and ends at 20.00. It will be held at Warung Bang Diary, Jl. Anggrek Cakra No. 52 Kelapa Dua Sasak, Kebon Jeruk, West Jakarta (see the link in caption).</p><p>Please click this link for location: <a href="https://waze.to/lr/hqqgutweqq" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">https://waze.to/lr/hqqgutweqq</a></p><p>- Britzone is supported by <a href="http://atmago.com/" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">Atmago.com</a> - <br/>AtmaGo is now available on playstore, please click this link to download: <a href="http://l.facebook.com/l.php?u=http%3A%2F%2Fwww.atmago.com%2Fandroid&amp;h=xAQEiGs5hAQEPEL1pyEvM8QoHSc_CSaa596PI0HvMgv2VHg&amp;enc=AZPiwxP5JDWXEyihCtP50YvP2Lc6SIdpk2QtSl1nE4xj-aTMmigMs9VMOpShS36NyI57k2jcOCcfQisIWvWc1FuVUPEB3FHWqetW83TeukeEK3iAmY58hnr4Jqlq-NXR2Efs5p3rQy2e9qNb7ndUyJaIDONlsAmBg6H5ddVPa2wOvh7v0866o-K8THOhXawiLwtkmQJLn5z4mvqE3ftnEzhW&amp;s=1" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">www.atmago.com/android</a></p><p><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1830882503859157" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1830882503859157" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1830882503859157" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1830882503859157" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1830882503859157" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bsa?source=feed_text&amp;story_id=1830882503859157" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BSA</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/englishcommunity?source=feed_text&amp;story_id=1830882503859157" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">EnglishCommunity</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/debating?source=feed_text&amp;story_id=1830882503859157" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Debating</span></span></a></p></div><!--EndFragment--><p><br/></p><p><br/></p>','contentable_id' => '12','contentable_type' => 'App\\Post','created_at' => '2016-12-21 08:40:42','updated_at' => '2016-12-21 08:40:42','deleted_at' => NULL),
  array('id' => '13','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=1371962616179097" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm" style="text-decoration: underline;">BritzoneTuesdayClass</span></span></a> proudly presents:<br/>&#34;<b>A Talk About Organization</b>&#34; by Eldy Taufiq</p><p style="font-size: 14px;">Organization is important because it allows individuals and groups to perform tasks more efficiently. It helps people find information and items faster, and it allows groups to work together without wasting time. Organization is important for dealing with information as well.</p><div class="text_exposed_show" style="font-size: 14px;"><p>All organizations have a management structure that determines relationships between the different activities and the members, and subdivides and assigns roles, responsibilities, and authority to carry out different tasks. Organizations are open systems - that affect and are affected by the environment.</p><p>Let\'s talk what organisation means to you! Tuesday, January 10th, 2017, start at 18.30 until 20.00 at Warung Bang Diary, Jalan Anggrek Cakra No. 52, Kelapa Dua, Kebon Jeruk, West Jakarta</p><p>Here is the address link :</p><p><a href="https://l.facebook.com/l.php?u=https%3A%2F%2Fwaze.to%2Flr%2Fhqqgutweqq&amp;h=ATMwX4Ns3ANTNYyjWi3aODxaINTbk7ksw9iDcEAuYl9howPqUmte6m7ropimhHLHPVxyPmyKBh3b80Bh9fjATLA3eWvDeLH0stmkZq_FoqLu1piB5yG9e-DLkbT6v1qQC1X9S7A&amp;enc=AZPO5sBf-CUnGAbHBXzi5OzqV6gXcmum4sN-ySCrzMzEraNpyxSBRK0_rSOVMG_zuGe4zimVKTjabKSw_Qzx3hnzJB2sfYJDtJz9WH39vgEYM6FeklfibRrXRN98_vizz9RWUN4bM-Q5z2tYTncHIma-8S9OZhoZt_vInTbDNR9JlSvD8WyiYrV-OfLhVDSQmf39ipWhx8QJk8rMZFBX-gWl&amp;s=1" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">https://waze.to/lr/hqqgutweqq</a></p><p>Please be punctual and see you there !</p><p><a class="_58c