ty?source=feed_text&amp;story_id=1371962616179097" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishCommunity</span></span></a></p></div><!--EndFragment--><p><br/></p><p><br/></p>','contentable_id' => '13','contentable_type' => 'App\\Post','created_at' => '2017-01-10 08:47:36','updated_at' => '2017-01-10 08:47:36','deleted_at' => NULL),
  array('id' => '14','content' => '<p>#BritzoneSpeakingAcademy presents:<br/>&#34;Resolution 2017 in Speaking&#34; by Akhmad Irfai<br/><br/>Life is a collection of experiences. As moments pass, memories remain. As time progresses, we learn, we grow, and we flow. We change ourselves, and we change the world (http://uscevents.com/event/resolution-2017/).<br/><br/>Everytime  year changes, we usually make resolutions on what we want to achieve in the following year. The resolution can be anything, can be about school, work, even soul mate or family. Of course there are things that needs to be done in order that the resolutions can be realized. It may be the same thing when it comes to achieving a certain capability, like for example, speaking English.<br/><br/>Some may have to put extra effort than the others to have resolution in Speaking. Some, for example, have to spend  a certain hours everyday to practice English speaking. Others may need to add another hours to practice. Some may have to take even years to be able to speak English fluently. Should we do the same thing or is there other way to be able to speak English well, if not fluently?<br/><br/>In the first meeting of BSA in 2017, we will discuss how to achieve your resolution in Speaking this year. If you want to know how to achieve it, then set the date, clear your schedule for Wednesday, January 11, 2017 and come join us in BSA class. We will practice to achieve our resolution in Speaking in 2017 with Fay, the head of BSA PICs. The class will be held in Warung bang Dairy, jl. Anggrek no 52, Kelapa Dua, Kebon Jeruk, West Jakarta. As always, the class will start from 18.30 and finish at 20.00. See you all there!<br/>#BritzoneID #britzone #BSA #Jakarta #FreeEnglishClub #FreeEnglishClass<br/></p>','contentable_id' => '14','contentable_type' => 'App\\Post','created_at' => '2017-01-11 08:01:12','updated_at' => '2017-01-11 08:01:12','deleted_at' => NULL),
  array('id' => '15','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=1379681568740535" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneTuesdayClass</span></span></a> proudly presents:<br/>&#34;Classroom Practice for IELTS Speaking&#34; by PIC of Tuesday Class</p><p style="font-size: 14px;">Practice makes a different. An aspect of life that practice helps us to cultivate is that of acknowledging change.</p><div class="text_exposed_show" style="font-size: 14px;"><p>Practicing a lot will sharpen our skill and makes us more ready facing the test. In IELTS test, especially in speaking, we will have an one-on-one conversation with an examiner who is a native speaker. When we get used to practice it, it will decrease our tension in nervousness.</p><p>Why practicing alone when practicing with a partner will help us be better?</p><p>So, the PIC of Tuesday class would like to bring you a class where we can practice together in speaking. So please clear you schedule this Tuesday, January 17, 2017, the class will be starting at 18.30 and ends at 20.00. it will be held at Warung Bang Diary, Jl. Anggrek No. 52, Kelapa Dua Sasak, kebon Jeruk, West Jakarta.</p><p>Here is the location’s link:<br/><a href="https://waze.to/lr/hqqgutweqq" target="_blank" rel="nofollow" style="color: rgb(54, 88, 153);">https://waze.to/lr/hqqgutweqq</a></p><p>Please be punctual and see you there!<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1379681568740535" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1379681568740535" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1379681568740535" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1379681568740535" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/ielts?source=feed_text&amp;story_id=1379681568740535" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">IELTS</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/speaking?source=feed_text&amp;story_id=1379681568740535" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">speaking</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1379681568740535" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a></p></div><!--EndFragment--><p><br/></p><p><br/></p>','contentable_id' => '15','contentable_type' => 'App\\Post','created_at' => '2017-01-17 11:08:09','updated_at' => '2017-01-17 11:08:09','deleted_at' => NULL),
  array('id' => '16','content' => '<div class="_5pbx userContent" id="js_5g" style="font-size: 14px;"><div id="id_58b524cc671916466977639" class="text_exposed_root text_exposed"><p><a class="_58cn" href="https://www.facebook.com/hashtag/britzonefunday?source=feed_text&amp;story_id=1376395149069177" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneFunDay</span></span></a> proudly presents:<br/>&#34;Watch and Learn&#34; by Bunga Use</p><p>Have you ever thought of a way of learning English while having fun at the same time? It might sound impossible at first, but fear not, for we are ready to show you.</p><div class="text_exposed_show"><p>This saturday, Britzone presents &#34;Watch &amp; Learn&#34; as we dive more deeply into learning how to communicate in English while watching your favorite films!</p><p>This saturday, Bunga will guide you through the discussion from 12.00 to 14.00 in Warung Bang Dairy, Jl. Anggrek no. 52, Klp. Dua, Kebon Jeruk. See you there!<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1376395149069177" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1376395149069177" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1376395149069177" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1376395149069177" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1376395149069177" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bfd?source=feed_text&amp;story_id=1376395149069177" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BFD</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/film?source=feed_text&amp;story_id=1376395149069177" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">film</span></span></a></p></div></div></div><div class="_3x-2" style="font-size: 12px;"><div><div class="mtm"><div class="_5cq3"><a class="_4-eo _2t9n" href="https://www.facebook.com/BritZoneEnglishClub/photos/a.536678959707471.1073741825.177118108996893/1376395149069177/?type=3" rel="theater" style="color: rgb(54, 88, 153);width: 476px;"><!--EndFragment--><br/></a></div></div></div></div>','contentable_id' => '16','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:28:12','updated_at' => '2017-02-28 07:28:12','deleted_at' => NULL),
  array('id' => '17','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonespeakingacademy?source=feed_text&amp;story_id=1380659061976119" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneSpeakingAcademy</span></span></a> proudly presents:<br/>&#34;Speech Practice&#34; by Jimmy Anwar</p><p style="font-size: 14px;">Speaking (sometimes termed oratory or oration) is the process or act of giving a performance focused around an individual\'s direct speech to a live audience. This speech is structured and deliberate with three general purposes: to inform, to persuade, and to entertain.</p><div class="text_exposed_show" style="font-size: 14px;"><p>Britzone Speaking academy is a program from Britzone which aims to enhance people\'s speaking ability in English. Speech is one of the ways from BSA class to encourage members and make them dare themselves in order to speak in English.</p><p>Jimmy Anwar, the President of Britzone, is going to conduct today\'s BSA class about speech. So this is your opportunity to have audience that support your speech in English. Don\'t miss our wednesday class tonight, on January 18, 2017. We\'re going to start at 18:30 and finish at 20:00. The location will be at Warung Bang Dairy, jl. Anggrek no 52, Kelapa Dua, Kebon Jeruk, West Jakarta.</p><p>See you all tonight!<br/>-Britzone is supported by AtmaGo.com-<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1380659061976119" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1380659061976119" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1380659061976119" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1380659061976119" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1380659061976119" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/speech?source=feed_text&amp;story_id=1380659061976119" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">speech</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bsa?source=feed_text&amp;story_id=1380659061976119" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BSA</span></span></a></p></div><p><br/></p>','contentable_id' => '17','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:29:56','updated_at' => '2017-02-28 07:29:56','deleted_at' => NULL),
  array('id' => '18','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonefunday?source=feed_text&amp;story_id=1383143828394309" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneFunDay</span></span></a> proudly presents:<br/>&#34;Coffee Culture&#34; by Toto Wiryoatmodjo</p><p style="font-size: 14px;">According to the history, coffee was first an energy drink, found by an ethiopian in Africa about 4000 years ago. But now, drinking coffee has become one of the strengths of culture in our country. It is one of the ways to celebrate special moment. By drinking a cup of coffee, conversation can be smoother and we can share good times with friends while drinking it.</p><div class="text_exposed_show" style="font-size: 14px;"><p>Coffee is one of the biggest commodity in the world; more than 50 countries have cultivated it. But originally, there are only 4 kinds of coffee in the world, Arabica coffee, Liberica coffee, Robusta, and Excelsa coffee.</p><p>If you want to know more about it, make sure you save the date and clear your schedule, because coffee is what we will discuss in BritZone Fun Day class on Saturday, January 21st, 2017. The class will be held from 12.00 to 14.00 at Warung Bang Dairy, jl. Anggrek no 52, Kelapa Dua Kebon Jeruk, West Jakarta, with Toto as the conductor.</p><p>So see you all there!<br/>- Britzone is supported by <a href="http://atmago.com/" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">AtmaGo.com</a> -<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1383143828394309" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1383143828394309" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1383143828394309" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1383143828394309" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1383143828394309" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/coffee?source=feed_text&amp;story_id=1383143828394309" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Coffee</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/barista?source=feed_text&amp;story_id=1383143828394309" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Barista</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bfd?source=feed_text&amp;story_id=1383143828394309" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BFD</span></span></a></p></div><p><br/></p>','contentable_id' => '18','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:31:07','updated_at' => '2017-02-28 07:31:07','deleted_at' => NULL),
  array('id' => '19','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=1387310057977686" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneTuesdayClass</span></span></a> proudly presents:</p><p style="font-size: 14px;">&#34;7 steps to polish up your speaking&#34; by Zelky Yusuf (President of Zone Of English Conversation)</p><p style="font-size: 14px;">Speak up and you\'ll be heard - Anonim</p><div class="text_exposed_show" style="font-size: 14px;"><p>Have you ever felt there was something wrong but you don\'t know what you have to do to fix it? Or have you ever felt you have to deliver something but you don\'t know the right sentences to deliver?</p><p>Perhaps you often feel it because of many things, like you don\'t have good preparation, or your vocab is still not sufficient or maybe you\'re just still nervous to speak!</p><p>Zelky yusuf, a president of Zeco (Zone of English Conversation, a famous facebook page with millions of followers) have some tips that he wants to share to us, to polish up your speaking and of course it can make you speak better.</p><p>Let\'s learn and practice it together. Save the date and clear your schedule this Tuesday, January 24, 2017. The class will start at 18.30 and end at 20.00. It will be held at Warung Bang Diary, Jl. Anggrek No. 52, Kelapa Dua Sasak, kebon Jeruk, West Jakarta.</p><p>Here is the location’s link:<br/><a href="https://waze.to/lr/hqqgutweqq" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">https://waze.to/lr/hqqgutweqq</a></p><p>- Britzone is supported by <a href="https://l.facebook.com/l.php?u=http%3A%2F%2FAtmago.com%2F&amp;h=ATOKzqjJhSLn23gtVlIy4Av0sJ94bct00f2ZICbDlCSfU-q-CHKgzFoIlMhsXnMZwidTEvyziMxz2H3dz99lSZcuUjNCl7k8DWL6vfGuwodCdfaz022Eze7H7FLJaDkQvtrz&amp;enc=AZO_IPeMFDSJc5-vrDe-FUAm9QWw_NWUY87Ia6EHI3c7F4qRGVpTdj_KuesHeleY4Of5nRfvYei064-D74SiZIvUcWuez-CCCRF1ywWnWfrrvHUzqQVJeykx3niXybBHznsxieEXH2iIeN-6k_MvUSwGOk4KiyhrKK2B3M2YboUN4-lYCvfrl7ID8eOaypCMrP-AD5YUxzxzQpkwSASsVnw3&amp;s=1" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">Atmago.com</a> - <br/>AtmaGo is now available on playstore, please click this link to download: <a href="http://www.atmago.com/android" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">www.atmago.com/android</a></p><p>Please be punctual and see you there!</p><p><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1387310057977686" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1387310057977686" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1387310057977686" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1387310057977686" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/ielts?source=feed_text&amp;story_id=1387310057977686" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">IELTS</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/speaking?source=feed_text&amp;story_id=1387310057977686" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">speaking</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1387310057977686" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/englishcommunity?source=feed_text&amp;story_id=1387310057977686" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">EnglishCommunity</span></span></a></p></div><p><br/></p>','contentable_id' => '19','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:32:43','updated_at' => '2017-02-28 07:32:43','deleted_at' => NULL),
  array('id' => '20','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonespeakingacademy?source=feed_text&amp;story_id=1388577577850934" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneSpeakingAcademy</span></span></a> proudly presents:<br/>&#34;How to Complain Less in Life&#34; by Hadissa Primanda</p><p style="font-size: 14px;">“You can complain because roses have thorns, or you can rejoice because thorns have roses.” —Tom Wilson</p><div class="text_exposed_show" style="font-size: 14px;"><p>Life is not perfect. It never has been and never will be. This is not bad news. In fact, once we begin to embrace this reality, we welcome a great number of possibilities. Life is never perfect. We know this to be true. Now, why then, do we complain about its imperfections?</p><p>We complain about the weather and the traffic. We also complain about tight clothing, misplaced keys, late airplanes, and the price of gasoline. Not to mention our jobs or our lack of jobs. Nosy neighbors, lazy friend, unworking government, we definitely have become a society too quick to complain.</p><p>There are times, of course, when it is good and proper to notify someone of an injustice. But most of the time, we express feelings of pain, dissatisfaction, or resentment simply because it is our natural response.</p><p>In today\'s meeting of BSA, we will discuss How to Complain Less in Life. If you would like to know how to do it, then save the date, clear your schedule and come join us in the class. It will be held on Wednesday, January 25th, 2017, with Hadissa Primanda as the conductor. The class will also be held in Warung Bang Dairy, at jl. Anggrek no 52, Kelapa Dua, Kebon Jeruk, West Jakarta, from 6.30 to 8 pm. Please come on time and practice to speak a lot.</p><p>See you all there.<br/>- Britzone is supported by <a href="https://l.facebook.com/l.php?u=http%3A%2F%2FAtmaGo.com%2F&amp;h=ATPNYjNP5RrUKUK6EXqkioueQ-lofoKDo1zJ-AemkkExcWuEMZBNKwiq0e44N4Vgua0F6RYCs9_4KohjHuhqZ146JzbeVeIUL5T0srzuOm0tGulXxrxfntY6uqUg-0Kq36NC&amp;enc=AZNiVGcm-V4uJ50nCQ8YZPN-xn_uOqlGi-8wMlM8aB6oMbZNJl-ncYuc3Cw76h0mqgbeehZlVFgGVddF7WnJxMXfoqs7Ikrm9gi_iubYmKT79pnPoxxEJ24ZdslP6nzJq_YMLw8K5DRxSlV0-wkFG1aWL7pk8Gzl3a5sF20qEMq-gOh1DlEiRU0NFqK1A83b6iQgsV2kMqN32840algw7igE&amp;s=1" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">AtmaGo.com</a> -<br/>@atmagoapp <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1388577577850934" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1388577577850934" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bsa?source=feed_text&amp;story_id=1388577577850934" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BSA</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/speaking?source=feed_text&amp;story_id=1388577577850934" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Speaking</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1388577577850934" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a></p></div><p><br/></p>','contentable_id' => '20','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:33:56','updated_at' => '2017-02-28 07:33:56','deleted_at' => NULL),
  array('id' => '21','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=1396131640428861" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneTuesdayClass</span></span></a> proudly presents:<br/>&#34;How to make a great conversation&#34; by Rocky Michael Tandi</p><p style="font-size: 14px;">Have you ever felt bored? Running out of material to talk about and not knowing what you want to say that makes you trapped in an awkward moment?</p><div class="text_exposed_show" style="font-size: 14px;"><p>We often feel enthusiastic talking with somebody and want to have a chit chat, but you can\'t make a conversation interesting enough most of the times.</p><p>And today, on our Tuesday class, Rocky Michael Tandi (english teacher and english coordinator) wants to share with us how to make a great conversation. It can be used if you want to impress someone or to make other people feel comfortable having a conversation with you.</p><p>Let\'s learn and practice it together. Save the date and clear your schedule this Tuesday, January 31, 2017. The class will start at 18.30 and end at 20.00. It will be held at Warung Bang Diary, Jl. Anggrek No. 52, Kelapa Dua Sasak, kebon Jeruk, West Jakarta.</p><p>Here is the location’s link:<br/><a href="https://waze.to/lr/hqqgutweqq" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">https://waze.to/lr/hqqgutweqq</a></p><p>Please be punctual and see you there!<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1396131640428861" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1396131640428861" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1396131640428861" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1396131640428861" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/conversation?source=feed_text&amp;story_id=1396131640428861" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">conversation</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1396131640428861" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a></p></div><p><br/></p>','contentable_id' => '21','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:36:06','updated_at' => '2017-02-28 07:36:06','deleted_at' => NULL),
  array('id' => '22','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonespeakingacademy?source=feed_text&amp;story_id=1397153336993358" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneSpeakingAcademy</span></span></a> proudly presents:<br/>&#34;How Can English Improve Your Life&#34; by Djanwar and Bunga</p><p style="font-size: 14px;">❝If you talk to a man in a language he understands, that goes to his head. If you talk to him in his own language, that goes to his heart.❞<br/>‒Nelson Mandela</p><div class="text_exposed_show" style="font-size: 14px;"><p>According to Wikipedia, Language is the ability to acquire and use complex systems of communication, particularly the human ability to do so, and a language is any specific example of such a system.<br/>A lot of people around the world across nation use English as their way to communicate and understand each other. We as Indonesian are quite often to see some phrases or even books in English. Those who understand English will be easy to get information from it.</p><p>Those information could be news, guidance to operate or to do something, and many other useful information in order to enhance our capacity building whether it is soft skill or hard skill.<br/>In other words, English can improve our life by getting information not only from our own native language but also from other state which mostly in English.</p><p>In this Britzone Speaking Academy, we are going to encourage you to share with other members of how can English improve your life so far with Djanwar and Bunga as the conductors. It is going to be more meaningful when you can share with others and inspire others with your own story.</p><p>Address yourself to join with Britzone on this wednesday February 1st, 2017 at 18.30 - 20.00. We are located at Warung Bang Dairy, jl. Anggrek no 52, Kelapa Dua, Kebon Jeruk, West Jakarta.<br/>Let\'s meet up and share, See you there!</p><p>- Britzone is supported by <a href="https://l.facebook.com/l.php?u=http%3A%2F%2FAtmaGo.com%2F&amp;h=ATPwmByEMhhUn9daMwZglLhzSDcmzx_D6jI9gv4MbNlCOkPB-aqDMxP-tobPdk-0E2rKqYGsmPMIY7IlFwZ_EnIq9nscd7f-ge0XifHPg1JppsbwPRntbRY3IYKKIHZnIRwv&amp;enc=AZOv40ikdXo-85N54b4mtLDgYIUArJutMNjTMOIi6QHkFGhPenABy3gpTRqxej9iboARXF8Pspu7kPqMpRJHcRv6kIAZOnrY0eQRRX9-_B7P1xpAPM7V2axc4nkQunY0Wti6dGX8Rt3xX11o9jddGZqky9QOXE79YCqrkhnMcIgyfzlbbnO-KIbM3C8sGmbax2IUXiVg4wO0_2ilTI4PmkXf&amp;s=1" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">AtmaGo.com</a> -<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1397153336993358" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1397153336993358" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1397153336993358" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1397153336993358" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1397153336993358" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bsa?source=feed_text&amp;story_id=1397153336993358" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BSA</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/speaking?source=feed_text&amp;story_id=1397153336993358" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">speaking</span></span></a></p></div><p><br/></p>','contentable_id' => '22','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:37:24','updated_at' => '2017-02-28 07:37:24','deleted_at' => NULL),
  array('id' => '23','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonefunday?source=feed_text&amp;story_id=1400442469997778" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneFunDay</span></span></a> proudly presents:<br/>&#34;How to Handle Stress at Work&#34; by Rizky Raditya</p><p style="font-size: 14px;">One of the most common forms of stress is that related to our careers and the workplace. But you\'re not powerless to the effects of stress at work. Effectively coping with job stress can benefit both your professional and personal life.</p><div class="text_exposed_show" style="font-size: 14px;"><p>Stress is experienced when there\'s a difference between what\'s required of us and what we feel we can deliver. Meet your boss and simply agree or re-set clear objectives, timescales and standards for whatever is expected of you.</p><p>Understanding how to manage, minimize, and deal with stress can help people feel more relaxed and react when stressful situations as they arise.</p><p>If you want to know more about it, make sure you save the date and clear your schedule, because this topic is what we will discuss in BritZone Fun Day class on Saturday, February 4th, 2017. The class will be held from 11.00 to 13.00 in Warung Bang Dairy, jl. Anggrek no 52, Kelapa Dua Kebon Jeruk, West Jakarta.</p><p>See you all there!<br/>- Britzone is supported by <a href="https://l.facebook.com/l.php?u=http%3A%2F%2FAtmago.com%2F&amp;h=ATNkpsgQaimU07HmRjAmu-IbVKOEX0456fHwLY-fZItT_wl-f4IsnwFIgCpfbcZ6syd9QO0eYfKcleOB1PfgTEipT552FQLareOIuSe_30twyG2QP-poSUpOakJQGxbH0ReP&amp;enc=AZPLMoXmD_jRcrsuoUdydYD5PFnQ-wdEu0rVJx2aJOhx-ff1ip1-_3m-St_tlMOUom81rkWOi7WGHhywmTuRxFPFNVJY7jjpa8xuIva1BKzzNBhSyXN9HFHGfH9LyiSnnBQaExTsF57i247_39ep-nM4N-47MFKSjYxnOzIutApr2PwN-wvM1HeMDD8hOWIUTleQUEfhzm1uKwI_Zw8q16ZY&amp;s=1" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">Atmago.com</a> -<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1400442469997778" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1400442469997778" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1400442469997778" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1400442469997778" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1400442469997778" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bfd?source=feed_text&amp;story_id=1400442469997778" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BFD</span></span></a></p></div><p><br/></p>','contentable_id' => '23','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:39:00','updated_at' => '2017-02-28 07:39:00','deleted_at' => NULL),
  array('id' => '24','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=1404368692938489" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneTuesdayClass</span></span></a> Proudly Presents : &#34;Get To Know The Neighbours : Show Around Your Imagination&#34; by Tari Potter<br/>&#34;Logic will get you from A to B. Imagination will take you anywhere&#34;. Albert E.</p><p style="font-size: 14px;">We have spent our lives seeing different other lives around the world through TV, books or internet. We see so many beautiful countries and we wish we could live there some day because we may just fall in love with the image. <br/>Or maybe friends of yours or your colleagues can tell you<span class="text_exposed_show"> how exciting it is living abroad.</span></p><div class="text_exposed_show" style="font-size: 14px;"><p>So, if you want to know what activity we are going to have today with our amazing English trainer Tari Potter, let\'s clear your schedule this Tuesday, Feb 7th, 2017. The class will be starting at 18.30-20.00 WIB.</p><p>We will have a class at :<br/>Rumah Belajar YCAB, Jl. Duta Buntu No.52B, RT.2/RW.7, Duri Kepa, Kb. Jeruk, Kota Jakarta Barat.</p><p>See this link for location : <br/><a href="https://l.facebook.com/l.php?u=https%3A%2F%2Fg.co%2Fkgs%2F4d64qA&amp;h=ATMldLUXubFgcd7VZfhQ26h77HJx4tRr1xe7p1eyEcYxkCa5Ay3TQL8TfpvpPd9J6AQ0WsV1-PcNEXRs8glV7IeJFF9em4OwSD0KpVI8xJoG3frMtRERHCEvAt5hhcRMdnwO&amp;enc=AZOQ4SuaG9fb468BW337tGj-j1MfbmQQoJWv92XEdN7wgsx5zDv2mPiWxmGVR99iV886mAkBiJl3WtXR-fhVkFn2mEYNJMkJjpvSn0rl4o4Wt97r7d5mUqHPoJCzwkrP18mCbXITN_1eH-rSPzk-KgEtKDzjXdZz40bs4-ap_KUSeWZSJd1R2QUP9hitSXq16I6LEjAU_R43-fex2r8Jb0AR&amp;s=1" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">https://g.co/kgs/4d64qA</a><br/>- Britzone is supported by <a href="http://atmago.com/" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">AtmaGo.com</a> -<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1404368692938489" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1404368692938489" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1404368692938489" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1404368692938489" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1404368692938489" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a></p></div><p><br/></p>','contentable_id' => '24','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:40:45','updated_at' => '2017-02-28 07:40:45','deleted_at' => NULL),
  array('id' => '25','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonespeakingacademy?source=feed_text&amp;story_id=1405415062833852" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneSpeakingAcademy</span></span></a> proudly presents:</p><p style="font-size: 14px;">&#34;Jakarta In The Future&#34; by Ahmad Irfai (Fay)</p><p style="font-size: 14px;">Jakarta, as the capital city of Indonesia, is the only city which status is at the same level as a province. According to Wikipedia, it is located in the coast of west side of Java island, with the 661,5 km² wide and 7,9 m high. Jakarta consists of 5 regions with the population of 9,608 million (United Nations: 2010). With the status and the priviledges, Jakarta becomes the city where any<span class="text_exposed_show">thing is possible. You can find various types of food, people, job, transportation, accomodation, not to mention parks and malls. People can get almost everything here, even now with the use of online services to get them.</span></p><div class="text_exposed_show" style="font-size: 14px;"><p>Now, of course, with greatness, comes difficulties. With all the advance way of life, there are still problems. For example, with the new transportation sytem as transjakarta, many conventional transport system now seems to have difficulties to live on. With the many development here and there, the problem of flood still remains. Not to mention there are also still many unemployment and the rate of crime which is &#34;still&#34; high.</p><p>Ahmad Irfai, the head of Britzone Speaking Academy or BSA, is going to conduct a discussion about Jakarta in the future for today\'s class. If you want to know how to practice your speaking ability and get solution for this problem, then this is your opportunity. Don\'t miss our wednesday class tonight, on February 8th, 2017. We\'re going to start at 18:30 and finish at 20:00.</p><p>We will have a class at :<br/>Rumah Belajar YCAB, Jl. Duta Buntu No.52B, RT.2/RW.7, Duri Kepa, Kb. Jeruk, Kota Jakarta Barat.</p><p>See this link for location : <br/><a href="https://g.co/kgs/4d64qA" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">https://g.co/kgs/4d64qA</a></p><p>Please be punctual and see you all there tonight!</p><p>- Britzone is supported by <a href="https://l.facebook.com/l.php?u=http%3A%2F%2FAtmaGo.com%2F&amp;h=ATNaNv50--7krLWfLKWP7bZ7-PjGIprifVDx3fGtMwLIvUmNqxz8DrK3r-S0I_Z0DN6GQRU23egn6n3moCdWlHd6TSVvAx6Rr4k8tftcUZUbeMaCheGAdACNRnsMDXTq0hAz&amp;enc=AZO0jlX-lxYJe7429iq9K85eGZ7GnGo-6dNCehhWbR8jGY33UXfrYtYrNJJeY7hPYG6whPzyUCvrygTFeyqHmAMSSUeuudBvJHAuzMgse1jKuRlIZMKdbARNKYF_OdIMAjh1VA0sUcGL0CtNGDvg9ItbX-SaR3FcClAZcwPlT7pLRQKevX3VayNII8U20m_WgYVaOU8kRRcOevXnuMJgIZoS&amp;s=1" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">AtmaGo.com</a> -</p><p><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1405415062833852" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1405415062833852" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1405415062833852" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1405415062833852" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishcommunity?source=feed_text&amp;story_id=1405415062833852" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishCommunity</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1405415062833852" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a></p></div><p><br/></p>','contentable_id' => '25','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:42:00','updated_at' => '2017-02-28 07:42:00','deleted_at' => NULL),
  array('id' => '26','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonefunday?source=feed_text&amp;story_id=1407988995909792" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneFunDay</span></span></a> proudly presents:<br/>&#34;Basic Self-Defense&#34;</p><p style="font-size: 14px;">The ability to defend ourselves could come in handy when the situation calls for it. Especially on the streets, where violent crimes such as robbery or sexual assault might occur to just about anyone.</p><div class="text_exposed_show" style="font-size: 14px;"><p>This saturday, Britzone will share tips and techniques for Basic Self-Defense, in an action-packed class conducted by Phantom MMA.</p><p>This saturday, Britzone will take place on the 3rd floor of Plaza Semanggi, in D\'cost, from 11.00 to 13.00. Don\'t miss it! <span class="_47e3 _5mfr" title="smile emoticon" style="vertical-align: middle;"><img class="img" height="16" src="https://www.facebook.com/images/emoji.php/v7/f4c/1/16/1f642.png" width="16" alt="" style="vertical-align: -3px;"/><span class="_7oe" style="font-size: 0px;width: 0px;">:)</span></span><br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1407988995909792" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1407988995909792" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1407988995909792" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/selfdefense?source=feed_text&amp;story_id=1407988995909792" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">SelfDefense</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1407988995909792" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1407988995909792" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bfd?source=feed_text&amp;story_id=1407988995909792" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BFD</span></span></a></p></div><p><br/></p>','contentable_id' => '26','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:43:14','updated_at' => '2017-02-28 07:43:14','deleted_at' => NULL),
  array('id' => '27','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=1412149165493775" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneTuesdayClass</span></span></a> proudly presents:<br/>&#34;Effective communication, How to engage in a discussion&#34; by Robin Lidan</p><p style="font-size: 14px;">Some people have difficulties in converting their thoughts into words. They often stumble while speaking which resulted in failure in winning a scholarship and even failure in getting a dream job despite their good academic and professional background.</p><div class="text_exposed_show" style="font-size: 14px;"><p>Indeed, taking part in discussions can be a daunting experience. Therefor, effective communication is essential in order to have a successful discussion.</p><p>So how do we engage in a discussion? In our Tuesday class, Robin Lidan will guide the way to create an effective communication including tips on how to improve your skills in conducting discussion.</p><p>If you want to know and practice the aforementioned, just save the date, clear your schedule and join us this Tuesday, February 14, 2017. The class will start at 18.30 and end at 20.00. It will be held at Mozilla Community Space Jakarta.</p><p>Here is the location’s link:<br/><a href="https://l.facebook.com/l.php?u=https%3A%2F%2Fgoo.gl%2Fmaps%2Fyg2k89oBTDG2&amp;h=ATMarayOTZmABrKVv8gvg0bOpFqNTnKHe_kOcX9nkhISPZ9Yn1nkihDEKXCwKvk-kxR-riyeJ7pfnr9fyPxQt6-goT6OpoP_vOH4pVa_YaKU8Jwqj_OrO0Cu3rIuqYR_2Szc&amp;enc=AZOuGRJmMeIg42qubgLMqJT1nmjOsCnUK3yw0fNpdOM-pVjOlKOvAu9WMTu6UnlO1lu7PbqrFApXOxVi_qNcm-moCF-JsFYwbMI-epWYCUshx2WxbL9fRd36N0uGuA6a_L8IVUe-91sXfeVw_dD5YcdtldXLZuhFuXYZpXdXWeel48OElpvB3EOLAx-TcGaDLtr-VEV35axokGwV86ukxSIZ&amp;s=1" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">https://goo.gl/maps/yg2k89oBTDG2</a></p><p>Please be punctual and see you there!<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1412149165493775" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1412149165493775" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1412149165493775" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1412149165493775" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/discussion?source=feed_text&amp;story_id=1412149165493775" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">discussion</span></span></a></p></div><p><br/></p>','contentable_id' => '27','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:44:54','updated_at' => '2017-02-28 07:44:54','deleted_at' => NULL),
  array('id' => '28','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonefunday?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneFunDay</span></span></a> proudly presents:<br/>&#34;How To Plan A Low-Budget Trip&#34; by Verlita</p><p style="font-size: 14px;">The world is full of affordable destinations, and it doesn\'t always require much effort to find them. No matter what the continent is, there are always places we can visit on a budget. No destination is ever really &#34;too expensive&#34;. It is not about our money or lack thereof, but whether we want to save it for other purposes or even to plan for upcoming trips.</p><div class="text_exposed_show" style="font-size: 14px;"><p>Low-budget hotels and airplane tickets are the best for low budget travellers. We can also backpack and share the cost.</p><p>Do you think that the vacation will be less fun and less amazing?</p><p>Verlita, a travel girl, would love to share her knowledge about setting up a low budget yet fun and wonderful trip on our Britzone\'s Saturday class.</p><p>So please clear your schedule and save the date. The class will be held on Saturday, Feb 18th, 2017. It will start at 11.00 AM sharp and end at 01.00 PM</p><p>Please bring your friends to learn and to practice your English together with us.</p><p>How about the venue ?</p><p>We proudly announce that the class will be held at Building A, THE LIBRARY of Ministry of Education and Culture, Jl. Jend. Sudirman, Jakarta.</p><p>Note : please all members register yourself as Library members as well. If you are already a member, please log in as you visit.</p><p>Please be punctual and see you there!<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bfd?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BFD</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/library?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">library</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/kemendikbud?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">kemendikbud</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/travel?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">travel</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1415953618446663" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a></p></div><p><br/></p>','contentable_id' => '28','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:46:34','updated_at' => '2017-02-28 07:46:34','deleted_at' => NULL),
  array('id' => '29','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=1420031501372208" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneTuesdayClass</span></span></a> Proudly Presents:<br/>&#34;Applied Linguistic To Spice Up Your Life&#34; by Kristyanto Buulolo</p><p style="font-size: 14px;">&#34;Life is an adventure without point. Try, fall, and sink or dont know something is a another taste from this world - KRP&#34;</p><div class="text_exposed_show" style="font-size: 14px;"><p>Do you speak Russian, Chinese or English? Whatever your language is, every language is unique and fun to know more about.</p><p>Language is not only about speaking, it can be about how to deliver it, or how to make people understand you even when you dont know what you are saying.</p><p>To know more about it, Kristian Buulolo, a language enthusiast, will help us learn and practice it together. So let\'s clear our schedule this Tuesday, Feb 21th, 2017. The class will start from 18.30-20.00 WIB.</p><p>We will have the class at :<br/>RUMAH BELAJAR YCAB, Jl. Duta Buntu No.52B, RT.2/RW.7, Duri Kepa, Kb. Jeruk, Kota Jakarta Barat.</p><p>See this link for location : <br/><a href="https://g.co/kgs/4d64qA" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">https://g.co/kgs/4d64qA</a></p><p>- Britzone is supported by <a href="https://l.facebook.com/l.php?u=http%3A%2F%2FAtmaGo.com%2F&amp;h=ATO0xII5pikAEfZQj_DjBSBVa29vU4ewfnKBEQV-MlmbbJ2qV3vhn64Rqi358AZW5OP_maj7733s_bbg6zXNJ6ctyWEX68DwSPbAZvmzxYZFLWLBuSc9X8XGtyHYt1dG9gp5&amp;enc=AZO--8iqbAH6Bp6S-Qba2vdsOYJm5FGB4TowRrtkC5CG098kshhU6ylfzeUsVPP6byJMiGXrFxq2gtP4TFEExD_lBPCFjxkmS4xQQ-ueoj7J8dhAoAAuXyLOj8vJFRNfQ42RDDMbjDPXSzuatR-aaSxKEYSQTp0kCfID0Af6fcR_ADfpPFhOdXiqjE64nmfeDTyr_x7cP_vvqAIcjxoNSRMQ&amp;s=1" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">AtmaGo.com</a> -<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1420031501372208" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1420031501372208" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1420031501372208" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1420031501372208" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1420031501372208" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/linguistics?source=feed_text&amp;story_id=1420031501372208" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">linguistics</span></span></a></p></div><p><br/></p>','contentable_id' => '29','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:47:35','updated_at' => '2017-02-28 07:47:35','deleted_at' => NULL),
  array('id' => '30','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonespeakingacademy?source=feed_text&amp;story_id=1421036281271730" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneSpeakingAcademy</span></span></a> proudly presents:<br/>&#34;Are You Listening?&#34; by Peggy Putri</p><p style="font-size: 14px;">&#34;The most basic of all human needs is the need to understand and be understood. The best way to understand people is to listen to them.&#34; — Ralph Nichols</p><div class="text_exposed_show" style="font-size: 14px;"><p>Has somebody ever asked you this question, &#34;are you listening&#34;? Maybe you were in a conversation with your friend and after a while your friend asked this question. Do you know what makes your friend do that? Could you possibly be multi-tasking in the conversation, like looking at your cell-phone, or day-dreaming, sometimes without you even realizing it?</p><p>Sometimes in a conversation or a class or an event, we tend to zone out when someone is talking or sometimes you wonder why people don\'t choose you as someone they want to share stories with. Peggy Putri, The COO of Paradigm is going to conduct about the art of listening to others.</p><p>If you are wondering about the content of our BSA Class tonight, make sure you are available to come on 22nd February 2017. We are going to start from 18:30 to 20:00 in Rumah Belajar YCAB, Duri Kepa, Kebon Jeruk, West Jakarta.<br/>See you there, tonight!<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1421036281271730" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1421036281271730" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1421036281271730" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/listening?source=feed_text&amp;story_id=1421036281271730" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Listening</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1421036281271730" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1421036281271730" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a></p></div><p><br/></p>','contentable_id' => '30','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:48:42','updated_at' => '2017-02-28 07:48:42','deleted_at' => NULL),
  array('id' => '31','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonefunday?source=feed_text&amp;story_id=1423573704351321" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneFunDay</span></span></a> Proudly presents:<br/>&#34;Musing&#34; by Verdy Bhawanta</p><p style="font-size: 14px;">It’s a busy world. You text your friends while listening to a conversation and to music. You plan your day while listening to the radio and commuting to work, and then you plan your weekend. But in the rush to accomplish necessary tasks, you may find yourself losing your connection with the present moment—missing out on what you’re doing and how you’re feeling. Did you notice whether you felt well-rested this morni<span class="text_exposed_show">ng or that forsythia is in bloom along your route to work?</span></p><div class="text_exposed_show" style="font-size: 14px;"><p>Mindfulness is the practice of purposely focusing your attention on the present moment—and accepting it without judgment. Mindfulness is now being examined scientifically and has been found to be a key element in happiness.</p><p>Do you know that mindfulness helps to increase your level of life satisfaction?</p><p>Do you know that being mindful makes it easier to savor the pleasures in life as they occur, helps you become fully engaged in activities, and creates a greater capacity to deal with adverse events?</p><p>Do you know that mindfulness improves your physical and mental health?</p><p>This Saturday, Britzone is going to discuss about what mindfulness is with Verdy Bhawanta, an actor, an athlete, and also the founder of Indobarian Indonesia.</p><p>So if you would like to know more about Mindfulness and how it works, let’s clear your schedule, the class will be held at Feb 25th, 2017, starting from 11.00 to 13.00 at the Library of Ministry of education and Culture, Jl. Jend Sudirman Kav. 4-5, Jakarta.</p><p>We also highly encourage you to register yourself as a member of the Library.</p><p>Please be punctual and see you there!<br/>- Britzone is supported by <a href="http://atmago.com/" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">AtmaGo.com</a> -<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1423573704351321" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1423573704351321" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1423573704351321" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">jakarta</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1423573704351321" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1423573704351321" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/bfd?source=feed_text&amp;story_id=1423573704351321" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BFD</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/mindfulness?source=feed_text&amp;story_id=1423573704351321" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">mindfulness</span></span></a></p></div><p><br/></p>','contentable_id' => '31','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:49:39','updated_at' => '2017-02-28 07:49:39','deleted_at' => NULL),
  array('id' => '32','content' => '<p style="font-size: 14px;"><a class="_58cn" href="https://www.facebook.com/hashtag/britzonetuesdayclass?source=feed_text&amp;story_id=1427450433963648" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneTuesdayClass</span></span></a> proudly presents:<br/>&#34;Be Yourself : Be A Conductor (Part 1)&#34; By Tari Potter (Former of Britzone’s President of 2010)</p><p style="font-size: 14px;">When you\'re invited to be a guest speaker for an organization’s luncheon or other meeting, you don’t want to be that speaker. And it can be terribly easy to be that speaker: You know, the high-maintenance one, or worse, the boring or irrelevant one.</p><div class="text_exposed_show" style="font-size: 14px;"><p>Usually a guest speaker is not closely connected with the event or the organizers. Generally, guest speakers add to the event by sharing an outside perspective, giving support, or by providing entertainment (or all three)! The key to being a successful guest speaker is to deliver a message that resonates with the audience AND is easy to work with.</p><p>Britzone is trying to bring the memory of Britzone back to when we had classes of how to prepare the members to be conductors. We will present this in two Tuesday classes.</p><p>So if you would like to know more of how to sharpen yourself to be a conductor, let’s clear your schedule , because we will have Miss tari Potter to share her knowledge about preparing and delivering a topic in a presentation.. This class is scheduled on Tuesday, Feb 28th, 2017 and will start at 18.30-20.00.</p><p>The class will be held at Rumah Belajar YCAB, Duri Kepa Jl. Duta Buntu No.52B, Duri Kepa, Kebon Jeruk.</p><p>- Britzone is supported by <a href="https://l.facebook.com/l.php?u=http%3A%2F%2FAtmaGo.com%2F&amp;h=ATNews7yPJiOf3hUZeeljx8p1sEylgYKf8XgxHwo59NGFGfQJfwqBTfjcvrrbyFCU13IhF9NaHYuMbvC1OLTzA7Cgmoic8ifBBZWlHM5qJJcFGZ3iQAxE0ju8Io0zHg811sI&amp;enc=AZOftmWGFpHcXFSOfmBQGZgl8mWkTNN_Y7IPHA5-mVfNrQtUo2P0w594-Hn2yY_J21T2_c8QlCTVIbMjxMkdi5NWYhspp_WV4L4NbpS7DkzQr2VunzRltXHNMgFsyaQT20k4Kt8vQrFugnOIRGpgb_uQT-NRMwkbkmo0sl-xKYQxS22_lHXBCtsphos7dVfYJ9F2vDUctwUeMtlDcAzOokhE&amp;s=1" target="_blank" rel="nofollow noopener" style="color: rgb(54, 88, 153);">AtmaGo.com</a> -<br/>See you there!<br/><a class="_58cn" href="https://www.facebook.com/hashtag/britzoneid?source=feed_text&amp;story_id=1427450433963648" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">BritzoneID</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/britzone?source=feed_text&amp;story_id=1427450433963648" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">britzone</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclub?source=feed_text&amp;story_id=1427450433963648" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClub</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/freeenglishclass?source=feed_text&amp;story_id=1427450433963648" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">FreeEnglishClass</span></span></a> <a class="_58cn" href="https://www.facebook.com/hashtag/jakarta?source=feed_text&amp;story_id=1427450433963648" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">Jakarta</span></span></a><a class="_58cn" href="https://www.facebook.com/hashtag/speaking?source=feed_text&amp;story_id=1427450433963648" style="color: rgb(54, 88, 153);"><span class="_5afx" style="direction: ltr;"><span class="_58cl _5afz">#</span><span class="_58cm">speaking</span></span></a></p></div><p><br/></p>','contentable_id' => '32','contentable_type' => 'App\\Post','created_at' => '2017-02-28 07:51:05','updated_at' => '2017-02-28 07:51:05','deleted_at' => NULL)
